            "sameAs": "https://twitter.com/agencialupa",
            "name": "Agência Lupa"
        },
        "claimReviewed": "De acordo com o conhecimento atual, o vírus SARS-CoV-2 tem um diâmetro de 60 nm a 140 nm [nanómetros (bilionésimo de um metro)] [16], [17], enquanto o diâmetro do fio das máscaras faciais médicas e não médicas varia de 55 µm a 440 µm [micrómetros (um milionésimo de metro), que é mais de 1000 vezes maior [25]. Devido à diferença de tamanhos entre o diâmetro do SARS-CoV-2 e o diâmetro do fio da máscara facial (o vírus é 1000 vezes menor), o SARS-CoV-2 pode facilmente passar por qualquer máscara (...) As evidências científicas existentes desafiam a segurança e eficácia do uso da máscara como intervenção preventiva para COVID-19. Os dados sugerem que as máscaras faciais médicas e não médicas são ineficazes para bloquear a transmissão humano a humano de doenças infecciosas e virais, como SARS-CoV-2 e COVID-19",
        "reviewRating": {
            "@type": "Rating",
            "ratingValue": 4,
            "bestRating": 6,
            "alternateName": "Falso",
            "image": ""
        },
