        "claimReviewed": "O uso de máscaras tem demonstrado ter efeitos fisiológicos e psicológicos adversos substanciais. Estes incluem hipóxia, hipercapnia, falta de ar, aumento da acidez e toxicidade, ativação do medo e resposta ao stress, aumento das hormonas do stress, imunossupressão, fadiga, dores de cabeça, declínio no desempenho cognitivo, predisposição para doenças virais e infecciosas, stress crónico, ansiedade e depressão. As consequências de longo prazo do uso de máscara podem causar deterioração da saúde, desenvolvimento e progressão de doenças crónicas e morte prematura",
